import React from "react";
import useRefExample from "../src/useRefExample";

const useRefEx = () => {
  return (
    <div>
      <useRefExample primaryImg="" secondaryImg />
      <useRefExample
        primaryImg="/static/CommonLoon.jpg"
        secondaryImg="/static/CommonLoon.jpg"
        alt=""
      />
      &nbsp;
      <br />
      <useRefExample
        primaryImg="/static/CrackingArt.jpg"
        secondaryImg="/static/CrackingArt.jpg"
        alt="Hi"
      />
    </div>
  );
};

export default useRefEx;
